import * as React from 'react';
export const ZoomContext = /*#__PURE__*/React.createContext({
  isInitialized: false,
  data: {
    isZoomEnabled: false,
    isPanEnabled: false,
    options: {},
    zoomData: [],
    setZoomData: () => {},
    isInteracting: false,
    setIsInteracting: () => {}
  }
});
if (process.env.NODE_ENV !== 'production') {
  ZoomContext.displayName = 'ZoomContext';
}
